/// <summary>
/// Initializes the history record based on a <c>MarkupTrans</c> record.
/// </summary>
/// <param name="_markupTrans">
/// The <c>MarkupTrans</c> record to use for initialization.
/// </param>
public void initFromMarkupTrans(MarkupTrans _markupTrans)
{
    MarkupTransMap markupTransMap;

    markupTransMap.data(_markupTrans.data());
    this.data(markupTransMap.data());
}

/// <summary>
/// Retrieves the related record in the <c>MarkupTable</c> table.
/// </summary>
/// <param name="_forUpdate">
/// A Boolean value that indicates whether to select the record for update; optional.
/// </param>
/// <returns>
/// A record in the <c>MarkupTable</c> table.
/// </returns>
/// <remarks>
/// This method calls to the same method on the <c>MarkupTrans</c> table.
/// </remarks>
MarkupTable  markupTable(boolean  _forUpdate = false)
{
    return this.markupTransOrig().markupTable(_forUpdate);
}

/// <summary>
/// Initializes a <c>MarkupTrans</c> record with the same field values as the current
/// <c>MarkupTransHistory</c> record.
/// </summary>
/// <returns>
/// A <c>MarkupTrans</c> record.
/// </returns>
/// <remarks>
/// The method is private as the record does not exist in the database and therefore is not available
/// externally.
/// </remarks>
private MarkupTrans markupTransOrig()
{
    MarkupTrans markupTrans;

    markupTrans.initFromMarkupTransHistory(this);
    markupTrans.setFieldValue(fieldStr(MarkupTrans,DataAreaId), this.DataAreaId);

    return markupTrans;
}

/// <summary>
/// Indicates whether a <c>MarkupTrans</c> record can participate in transaction matching.
/// </summary>
/// <returns>
/// true if the current record can participate in transaction matching; otherwise, false.
/// </returns>
public display MarkupUseInMatching useInMatching()
{
    return this.markupTable().UseInMatching;
}

/// <summary>
/// Indicates whether the specified <c>MarkupTrans</c> record has any history stored in the
/// <c>MarkupTransHistory</c> table.
/// </summary>
/// <param name="_markupTrans">
/// A <c>MarkupTrans</c> record for which to check existence of history versions.
/// </param>
/// <returns>
/// true if a history of the specified record exists; otherwise, false.
/// </returns>
public static boolean exist(MarkupTrans _markupTrans)
{
    if (_markupTrans.TransTableId  &&
        _markupTrans.TransRecId      )
    {
        return (select firstonly markupTransHistory
                    where markupTransHistory.TransTableId  == _markupTrans.TransTableId  &&
                          markupTransHistory.TransRecId    == _markupTrans.TransRecId    &&
                          markupTransHistory.LineNum       == _markupTrans.LineNum
                   ).RecId != 0;
    }

    return false;
}

/// <summary>
/// Finds the specified record in the <c>MarkupTransHistory</c> table.
/// </summary>
/// <param name="_markupTrans">
/// A <c>MarkupTrans</c> record for which to find a history version.
/// </param>
/// <param name="_validTime">
/// A time for which to find a valid history version.
/// </param>
/// <returns>
/// A <c>MarkupTransHistory</c> record if one exists; otherwise, an empty record.
/// </returns>
static MarkupTransHistory find(MarkupTrans _markupTrans, utcdatetime _validTime = DateTimeUtil::utcNow())
{
    MarkupTransHistory markupTransHistory;

    if (_markupTrans.TransTableId  &&
        _markupTrans.TransRecId      )
    {
        select firstonly validTimeState(_validTime) markupTransHistory
            where markupTransHistory.TransTableId           == _markupTrans.TransTableId
            &&    markupTransHistory.TransRecId             == _markupTrans.TransRecId
            &&    markupTransHistory.LineNum                == _markupTrans.LineNum;
    }

    return markupTransHistory;
}
